    private static String filter(String s, boolean debug) {
        String original = s;
        if(debug) System.out.println("1"+s);
        s = s.replaceAll("[\\t\\n\\r]"," ").toLowerCase();
        if(debug) System.out.println("2"+s);
        ArrayList<String> split = new ArrayList(Arrays.asList(s.split(" ")));
        for(int i = 0 ; i < split.size(); i++) {
            if(split.get(i).contains("http") || split.get(i).equals("")) {
                split.remove(i);
                i--;
            }
        }

        s = StringUtils.join(split," ");
        if(debug) System.out.println("3"+s);
        StringBuilder newString = new StringBuilder("");
        for(char c : s.toCharArray()) {
                if (characters.contains(String.valueOf(c)) || emojis.contains(String.valueOf(c))) {
                    newString.append(c);
                }
        }
        s = newString.toString();
        if(debug) System.out.println("4"+s);
        s = EmojiParser.parseToAliases(s);
        if(debug) System.out.println("4"+s);
        StringBuilder sb = new StringBuilder();
        s = " "+s;
        String[] split2 = s.split(":");
        for(int i = 0 ; i < split2.length; i++) {
            if(debug) System.out.println(i+"="+split2[i]);
            if(i%2==0) {
                sb.append(split2[i]);
                sb.append(" :");
            }else {
                sb.append(split2[i]);
                sb.append(": ");
            }
        }
        s = EmojiParser.parseToUnicode(sb.toString());
        if(debug) System.out.println("6"+s);
        if(s.contains("?") && !debug) {
            filter(original, true);
        }
        return s.replaceAll(":","").replaceAll("\\s+", " ").trim();
    }
